import React from 'react';
import styles from './Button.module.css'

export const Button = () => {
    const myFirstSubscriber1 = (event: MouseEvent<HTMLButtonElement>) => {
        alert('Hello Victor!')
        console.log('Hello Victor! in console')
    }
    const myFirstSubscriber2 = () => {
        alert('Hello my Friend!')
        console.log('Hello my Friend! in console')
    }


    return (
        <div className={styles.backgraund__button}>
            <div>
                <button onClick={myFirstSubscriber1} className={styles.btn1}>My firs Chanel #1
                </button>
            </div>
            <div>
                <button onClick={myFirstSubscriber2} className={styles.btn2}>My firs Chanel #2
                </button>
            </div>
        </div>
    );
};
